600; // Relaci√≥n de aspecto de la pantalla\n          const frustumSize =5; // Tama√±o del √°rea visible de la c√°mara\n          this.camera = new THREE.OrthographicCamera(\n            -frustumSize * aspect / 3, // L√≠mite izquierdo\n            frustumSize * aspect / 3,  // L√≠mite derecho\n            frustumSize / 3,           // L√≠mite superior\n            -frustumSize / 3,          // L√≠mite inferior\n            0.1,                       // Plano cercano\n            1000                       // Plano lejano\n          );\n          this.camera.position.set(0, 0, 1);  // Posici√≥n de la c√°mara\n\n          // Renderer con fondo transparente\n          this.renderer = new THREE.WebGLRenderer({ antialias: false, alpha: true });\n          this.renderer.setSize(800, 600);\n          this.renderer.setPixelRatio(window.devicePixelRatio);\n\n          this.shadow.appendChild(this.renderer.domElement);  // A√±adir el canvas al shadow DOM\n\n          // Cargar el modelo\n          this.loadModel();\n\n          // Luz\n          const light = new THREE.PointLight(0xffffff, 2);\n          light.position.set(5, 9, 3);\n          this.scene.add(light);\n\n          window.addEventListener('mousemove', this.onMouseMove.bind(this));\n          window.addEventListener('wheel', this.onScroll.bind(this));\n\n          // Deshabilitar la actualizaci√≥n del tama√±o del renderer en resize\n          // El tama√±o se mantendr√° fijo en 800x600\n\n          this.animate();\n        }\n\n        loadModel() {\n          const loader = new GLTFLoader();\n          const modelURL = 'https://tonnyparrano.website/orange/lowpoly8.glb'; // Cambia esta URL al modelo que deseas usar\n\n          // Cargar el modelo GLB\n          loader.load(modelURL, (gltf) => {\n            this.model = gltf.scene;\n\n            // Aplicar el material wireframe\n            this.model.traverse((child) => {\n              if (child.isMesh) {\n                child.material = new THREE.MeshBasicMaterial({\n                  color: 0xffffff, // Color del wireframe\n                  wireframe: true, // Activar el modo wireframe\n                });\n              }\n            });\n\n            this.scene.add(this.model);\n\n            // Cargar las animaciones del modelo\n            this.animations = gltf.animations;\n            if (this.animations && this.animations.length > 0) {\n              // Crear un AnimationMixer para controlar las animaciones\n              this.mixer = new THREE.AnimationMixer(this.model);\n            }\n          });\n        }\n\n        onMouseMove(event) {\n          // Normalizar las posiciones del mouse\n          this.mouseX = (event.clientX / window.innerWidth) * 2 - 1;\n          this.mouseY = -(event.clientY / window.innerHeight) * 2 + 1;\n\n          // Establecer las rotaciones objetivo basadas en la posici√≥n del rat√≥n\n          this.targetRotationX = this.mouseY * Math.PI * 0.05;\n          this.targetRotationY = this.mouseX * Math.PI * 0.05;\n        }\n\n        onScroll(event) {\n          this.scrollVelocity += event.deltaY * this.scrollSpeed;\n        }\n\n        animate() {\n          requestAnimationFrame(this.animate.bind(this));\n\n          // Actualizar las animaciones (si existen)\n          if (this.mixer) {\n            this.mixer.update(0.01); // Puedes ajustar la velocidad de la animaci√≥n cambiando este valor\n          }\n\n          if (this.model) {\n            // Interpolaci√≥n para retrasar el movimiento\n            this.model.rotation.x += (this.targetRotationX - this.model.rotation.x) * this.smoothFactor;\n            this.model.rotation.y += (this.targetRotationY - this.model.rotation.y) * this.smoothFactor;\n\n            this.model.rotation.y += this.scrollVelocity * 0.0027\n          }\n\n          // Renderizar la escena con el efecto wireframe\n          this.renderer.render(this.scene, this.camera);\n        }\n      }\n\n      customElements.define('wireframe-scene', WireframeScene);\n    </script>\n\n    <wireframe-scene model-scale=\"2\"></wireframe-scene> <!-- Aqu√≠ cambia el tama√±o del modelo GLB -->\n  </body>\n</html>\n"],"id":207,"k":12,"n":"cubofinal","rp":[[0,0,{"f":[0],"fe":[0,0,100,100,100,0,0,0],"l":["none"],"r":[-1248.2063896484374,593,769.333,546.03,0],"t":[[],[],[],[-233.29659398396814,306.666408220927,0]]}]]}],"id":107,"k":6,"n":"cubos slide","rp":[[0,0,{"f":[0],"fe":[0,0,100,100,100,0,0,0],"l":["none"],"r":[1600,3183.535888671875,6283.3802490234375,763.3291015625,0]}]]},{"ch":["div",""],"id":338,"k":12,"n":"letras","rp":[[0,0,{"f":[0],"fe":[0,0,100,100,100,0,0,0],"l":["none"],"r":[-506.29138964843753,2698.969970703125,2076,128,0],"t":[[],[],[],[28.0364990234375,-2,0]]}]]},{"elems":[{"id":441,"k":4,"n":"Text_5","rp":[[0,0,{"cl":"carousel","f":[0],"fe":[0,0,100,100,100,0,0,0],"l":["none"],"r":[9.765624994884092e-06,5.615234385913936e-06,6632.69,176.002,0],"txt":["<p><span style=\"font-weight: bold;\">&nbsp; &nbsp; ONCHAIN&nbsp; &nbsp; INTELLIGENCE&nbsp; &nbsp; ENGINE&nbsp; &nbsp; ONCHAIN&nbsp; &nbsp; INTELLIGENCE&nbsp; &nbsp; ENGINE&nbsp; &nbsp; ONCHAIN&nbsp; &nbsp; INTELLIGENCE&nbsp; &nbsp; ENGINE</span></p>","'Clash Display'",120,[255,255,255,255],[0,0,0,0],"bold",0,0,0,1,128,120,0,0,0]}],[3,0,{"r":[9.765625009094947e-06,-1.9531250018189894e-05,6632.69,176.002,0]}]]}],"id":442,"k":6,"n":"Group_8","rp":[[0,0,{"f":[0],"fe":[0,0,100,100,100,0,0,0],"l":["none"],"r":[-477.2642822265625,-835.3527407324218,6632.690185546875,176.00201416015625,0],"t":[[],[],[],[63.0362548828125,-1.999786376953125,0]]}],[3,0,{"of":1,"r":[-354,2268.879264882812,1708,176.001953125,0],"t":[[],[],[],[63.03643798828125,-2,0]]}],[4,0,{"r":[-467.2642822265625,-831.5220007324219,6632.690185546875,176.00201416015625,0],"t":[[],[],[],[63.0362548828125,-1.999725341796875,0]]}]]},{"elems":[{"id":446,"k":4,"n":"Text_5_1","rp":[[0,0,{"cl":"carousel","f":[0],"fe":[0,0,100,100,100,0,0,0],"l":["none"],"r":[9.765624994884092e-06,5.615234385913936e-06,6632.69,